CREATE function [dbo].[choice](@string varchar(200), @delimiter varchar(2))
RETURNS @table TABLE (items VARCHAR(200))
AS
BEGIN
insert into @table  SELECT * FROM STRING_SPLIT(@string, @delimiter)
return
end
