/****** Object:  StoredProcedure [dbo].[Exam_Random_generation]    Script Date: 4/1/2021 2:59:08 PM ******/
SET ANSI_NULLS ON
GO
SET QUOTED_IDENTIFIER ON
GO
CREATE PROC [dbo].[Exam_Random_generation]  @cur_name VARCHAR(20), @no_TF INT, @no_MC INT, @exam_time int, @exam_gread int
AS
begin
	INSERT INTO Exam(ExamGrade , ExamTime, CurId)
	VALUES     (@exam_gread, @exam_time,
			   (SELECT CurId FROM Course WHERE CurName = @cur_name))

DECLARE @ex_id INT
SELECT  @ex_id = MAX(ExamId) FROM Exam

INSERT INTO Exam_Question    --Generate true & false Question
	SELECT TOP(@no_TF) @ex_id, Q.QuesId
	FROM Question Q JOIN course C ON C.CurId =Q.CurId
	WHERE C.CurName = @cur_name AND Q.QuesType IN('TF')
	ORDER BY NEWID()	
INSERT INTO Exam_Question	--Generate true & false Question
	SELECT TOP(@no_MC) @ex_id, Q.QuesId
	FROM Question Q JOIN course C ON C.CurId =Q.CurId
	WHERE C.CurName = @cur_name AND Q.QuesType IN('MC')
	ORDER BY NEWID()

SELECT  Q.QuesId, Q.question, A, B, C, D  --Return Exam Question
	FROM Question Q inner JOIN Choices mcq ON Q.QuesId =mcq.QuesId
	JOIN Exam_Question EX ON Q.QuesId = EX.QuesId
	WHERE EX.ExamId = @ex_id

end
GO
/****** Object:  StoredProcedure [dbo].[Exam_student]    Script Date: 4/1/2021 2:59:08 PM ******/
SET ANSI_NULLS ON
GO
SET QUOTED_IDENTIFIER ON
GO
create PROC [dbo].[Exam_student] @student_id int, @course_id int
AS
IF not EXISTS (SELECT * FROM Student_Course WHERE StuId = @student_id AND CurId = @course_id)
SELECT 'you are not recorded at this course'
ELSE
	begin
	DECLARE @exam_id int
	SELECT  @exam_id = MAX(ExamId) FROM Exam
	WHERE   CurId = @course_id
	ORDER BY NEWID()

	DECLARE @Number_Questoin int
	SELECT @Number_Questoin = COUNT(QuesId) FROM Exam_Question
	WHERE  ExamId = @exam_id

	SELECT @exam_id Exam_ID, q.QuesId, q.question, A,B,C,D , ExamTime, @Number_Questoin Num_Q_exam
	FROM Question q JOIN Choices mcq ON Q.QuesId = mcq.QuesId
	JOIN Exam_Question eq ON q.QuesId = eq.QuesId
	JOIN Exam e ON e.ExamId = eq.ExamId
	WHERE eq.ExamId = @exam_id
	ORDER BY NEWID()
	end
	
GO
/****** Object:  StoredProcedure [dbo].[P_exam_correction]    Script Date: 4/1/2021 2:59:08 PM ******/
SET ANSI_NULLS ON
GO
SET QUOTED_IDENTIFIER ON
GO
Create PROC [dbo].[P_exam_correction] @StuId int, @examId int
AS
	SELECT q.QuesId, q.QuesAnswer, se.StudQuesAns, 0 as grade into #tempTable
	  FROM [ExaminationSystem].[dbo].[Student_Exam] se
	  join Question q on q.QuesId = se.QuesId
	  where StudId = @StuId and se.ExamId = @examId

	declare @QuesAnswer varchar(3) 
	declare  @StudQuesAns varchar(3) 
	declare  @grade int 


	DECLARE db_cursor CURSOR FOR 
	SELECT QuesAnswer, StudQuesAns, grade
	FROM #tempTable

	OPEN db_cursor  
	FETCH NEXT FROM db_cursor INTO @QuesAnswer, @StudQuesAns, @grade  

	WHILE @@FETCH_STATUS = 0  
	BEGIN  
      
		  if( @QuesAnswer = @StudQuesAns)
			update #tempTable set grade = 1
			where current of db_cursor
	  
		  FETCH NEXT FROM db_cursor INTO @QuesAnswer, @StudQuesAns, @grade  
	END 

	CLOSE db_cursor  
	DEALLOCATE db_cursor 
	
	select sum(grade) from #tempTable


	drop table #tempTable
 
GO
