CREATE PROC [dbo].[sp_addDepartment] @deptName NVARCHAR(50), @deptManagerId INT
AS
BEGIN

IF EXISTS (SELECT* FROM Department WHERE DeptName = @deptName) 
	SELECT 'There are department with the same name'
ELSE IF @deptManagerId IS NULL
BEGIN
	INSERT INTO Department (DeptName) VALUES (@deptName)
	SELECT 'Department inserted successfully'
END
ELSE IF EXISTS (SELECT* FROM instructor WHERE InsId = @deptManagerId)
	BEGIN
		INSERT INTO Department (DeptName,MangerID) VALUES (@deptName, @deptManagerId)
		SELECT 'Department inserted successfully'
	END
	ELSE
		SELECT 'Selected Manager does not exists'
END
 	
GO
