/****** Object:  StoredProcedure [dbo].[sp_student_Exam]    Script Date: 4/1/2021 2:59:08 PM ******/
SET ANSI_NULLS ON
GO
SET QUOTED_IDENTIFIER ON
GO
CREATE PROC [dbo].[sp_student_Exam] @student_id int, @course_id int
AS
IF not EXISTS (SELECT * FROM Student_Course WHERE StuId = @student_id AND CurId = @course_id)
	SELECT 'you are not recorded at this course' as error
ELSE
	begin
	DECLARE @exam_id int
	SELECT  @exam_id = MAX(ExamId) FROM Exam
	WHERE   CurId = @course_id
	ORDER BY NEWID()

	DECLARE @Number_Questoin int
	SELECT @Number_Questoin = COUNT(QuesId) FROM Exam_Question
	WHERE  ExamId = @exam_id

	SELECT @exam_id Exam_ID, q.QuesId, q.question, mcq.A,mcq.B,mcq.C,mcq.D,q.QuesType,e.ExamTime, @Number_Questoin Num_Q_exam
	FROM Question q 
	JOIN Choices mcq ON Q.QuesId = mcq.QuesId
	JOIN Exam_Question eq ON q.QuesId = eq.QuesId
	JOIN Exam e ON e.ExamId = eq.ExamId
	WHERE eq.ExamId = @exam_id
	ORDER BY NEWID()
	end
GO
