--update department
CREATE PROC [dbo].[sp_updateDepartment] @deptId INT,@deptName NVARCHAR(50),@deptManagerId INT
AS
BEGIN
IF EXISTS (SELECT* FROM Department WHERE DeptName = @deptName AND MangerID = @deptManagerId) 
	SELECT 'There are department with the same name'
ELSE IF @deptManagerId IS NULL
BEGIN
	UPDATE Department SET DeptName = @deptName, MangerID = @deptManagerId  WHERE DeptId = @deptId
	SELECT 'Department Updated successfully'
END
ELSE IF EXISTS (SELECT* FROM instructor WHERE InsId = @deptManagerId)
	BEGIN
		UPDATE Department SET DeptName = @deptName, MangerID = @deptManagerId  WHERE DeptId = @deptId
		SELECT 'Department Updated successfully'
	END
	ELSE
		SELECT 'Selected Manager does not exists'
END

SELECT TOP (1)* FROM Department
ORDER BY DeptId DESC


GO
